// SPDX-License-Identifier: MIT
pragma solidity ^0.8.11;
pragma experimental ABIEncoderV2;

import "./ProductInfo.sol";
import "./OrderRequestInfo.sol";

contract Product {
    //product batch status
    BatchStatus public status;
    //Basic details
    ProductBasicInfo public productBasicInfo;
    //Advance details
    ProductAdvanceInfo public productAdvanceInfo;

    // custom error
    error UnderProcess(string message);
    error PriceMismatch(string message);

    //Create new instance of Product batch by distributor .
    //@param _productName String Name of product
    //@param _productDesc String Desc of product
    //@param _warehouseLoc String Location of product
    //@param _quantity Uint256 Product quantity
    //@param _price Uint256 Product price
    //@param _totalPrice Uint256 Total batch price
    //@param _manufacturerName String Manufacturer name
    //@param _manufacturerLoc String Manufacturer location
    //@param _transporter Address transporter address
    //@param _retailer Address retailer store address
    constructor(
        address _orderRequestId,
        string memory _productName,
        string memory _productDesc,
        string memory _warehouseLoc,
        uint256 _quantity,
        uint256 _price,
        string memory _manufacturerName,
        string memory _manufacturerLoc,
        address _transporter, // logistic
        address _retailer, // receiver
        address _distributor
    ) {
        productBasicInfo.orderRequestId = _orderRequestId;
        productBasicInfo.productId = address(this);
        productBasicInfo.productName = _productName;
        productBasicInfo.productDesc = _productDesc;
        productBasicInfo.warehouseLoc = _warehouseLoc;
        productBasicInfo.quantity = _quantity;
        productBasicInfo.quantityRemain = _quantity;
        productBasicInfo.price = _price;
        productBasicInfo.totalPrice = _quantity * _price;
        productAdvanceInfo.batchStatus = BatchStatus(0);
        productAdvanceInfo.manufacturerName = _manufacturerName;
        productAdvanceInfo.manufacturerLoc = _manufacturerLoc;
        productAdvanceInfo.transporter = _transporter;
        productAdvanceInfo.retailer = _retailer;
        productAdvanceInfo.distributor = _distributor;
        productAdvanceInfo.lastModifiedTimestamp = block.timestamp;
    }

    //Update product details with incoming latest values
    function updateProductBatchDetails(
        string memory _productName,
        string memory _productDesc,
        string memory _warehouseLoc,
        uint256 _quantity,
        uint256 _price,
        string memory _manufacturerName,
        string memory _manufacturerLoc,
        address _transporter, // logistic
        address _retailer // receiver
    ) public returns (bool) {
        productBasicInfo.productName = _productName;
        productBasicInfo.productDesc = _productDesc;
        productBasicInfo.warehouseLoc = _warehouseLoc;
        productBasicInfo.quantity = _quantity;
        productBasicInfo.quantityRemain = _quantity;
        productBasicInfo.price = _price;
        productBasicInfo.totalPrice = _quantity * _price;
        productAdvanceInfo.manufacturerName = _manufacturerName;
        productAdvanceInfo.manufacturerLoc = _manufacturerLoc;
        productAdvanceInfo.transporter = _transporter;
        productAdvanceInfo.retailer = _retailer;
        productAdvanceInfo.lastModifiedTimestamp = block.timestamp;
        return true;
    }

    //Retrieve product details using ProductId
    function getProductInfo()
        public
        view
        returns (
            ProductBasicInfo memory _productBasicInfo,
            ProductAdvanceInfo memory _productAdvanceInfo,
            uint256 _status
        )
    {
        return (
            productBasicInfo,
            productAdvanceInfo,
            uint256(productAdvanceInfo.batchStatus)
        );
    }

    //Retrieve product basic details using ProductId
    function getProductBasicInfo()
        public
        view
        returns (ProductBasicInfo memory _productBasicInfo)
    {
        return productBasicInfo;
    }

    //Update quantity after sell
    //@param UpdatedQuantity uint256
    function updateQuantity(uint256 _updatedQty) public {
        productBasicInfo.quantity = _updatedQty;
        productBasicInfo.quantityRemain = _updatedQty;
        productAdvanceInfo.lastModifiedTimestamp = block.timestamp;
    }

    //Get the Product batch status.
    function getProductBatchStatus() public view returns (uint256) {
        return uint256(productAdvanceInfo.batchStatus);
    }

    //Get the order id.
    function getOrderRequestId() public view returns (address) {
        return productBasicInfo.orderRequestId;
    }

    //Initiate product transit by Distributor
    function initiateTransit() public returns (bool) {
        return updateBatchStatus(1, 0);
    }

    //Cancel product shipment by Distributor
    function cancelProductShipment(string memory _reason)
        public
        returns (bool)
    {
        bool updatedFlag = updateBatchStatus(2, 1);
        if (updatedFlag) {
            productAdvanceInfo.reasonForShipmentCancellation = _reason;
        }
        productAdvanceInfo.lastModifiedTimestamp = block.timestamp;
        return updatedFlag;
    }

    //Cancel package shipment by Transporter
    function cancelPackageShipment(string memory _reason)
        public
        returns (bool)
    {
        bool updatedFlag = updateBatchStatus(2, 3);
        if (updatedFlag) {
            productAdvanceInfo.reasonForShipmentCancellation = _reason;
        }
        productAdvanceInfo.lastModifiedTimestamp = block.timestamp;
        return updatedFlag;
    }

    //Pick product batch for shipment by shipper to deliver from warehouse to retailer store
    function initiateProductBatchForShipment() public returns (bool) {
        return updateBatchStatus(3, 1);
    }

    //update product batch status after successfully delivered from warehouse to retailer store
    function updateProductBatchStatusToDeliver() public returns (bool) {
        return updateBatchStatus(4, 3);
    }

    //Delivered product batch rejected by Retailer
    function rejectProductBatch(string memory _reason) public returns (bool) {
        bool updatedFlag = updateBatchStatus(5, 4);
        if (updatedFlag) {
            productAdvanceInfo.reasonForPackageRejection = _reason;
        }
        return updatedFlag;
    }

    //Delivered product batch approved by retailer
    function approveProductBatch() public returns (bool flag) {
        return updateBatchStatus(6, 4);
    }

    //Generic method to update product batch status
    function updateBatchStatus(uint256 _updatedStatus, uint256 _prevStatus)
        private
        returns (bool flag)
    {
        if (isOrderActive()) {
            if (productAdvanceInfo.batchStatus == BatchStatus(_prevStatus)) {
                productAdvanceInfo.batchStatus = BatchStatus(_updatedStatus);
                return true;
            } else {
                revert UnderProcess("PREVIOUS_STEP_NOT_COMPLETED");
            }
        }
    }

    function isOrderActive() private view returns (bool flag) {
        if (
            OrderRequestInfo(productBasicInfo.orderRequestId)
                .getOrderRequestStatus() != 3
        ) {
            revert("ORDER_CANCELED");
        }
        return true;
    }
